INSERT INTO `comments` VALUES (1,'比我想的容易，上到最高处有点陡峭，但是风景不错，去的时候人还不是很多，靠墙边能看到斜坡上红色绿色相夹杂的树木，基本覆盖了地表。风里带点沙土气息，很干。远处望去长城绵延不断，映衬着破损的古墙壁，有种人力伟大的震撼感，要造这样的规模，在当时可算奇迹了。','古韵','慕田峪长城',26),(2,'总体而言还是值得一看的，人没有八达岭那么多，有索道也有滑道，价格不便宜但玩得很快乐。\n不过长城也就那么回事，没看过可以来看看，看过了也适合来秋游。','京郊值得一探，别抱太大期望','慕田峪长城',31),(3,'之前慕田峪长城，有很多外国人游览，现在基本都变成国内客人了，总体上看，长城景色很漂亮，森林覆盖率高，一共开放了20个烽火台，比八达岭长城要多。另外，做为一名北京人，建议还是乘坐慕巴士直通车，不必自驾，爬完长城腿累得哆嗦。','慕田峪长城之旅','慕田峪长城',11),(4,'一提到长城，大家第一个想到的去“八达岭长城”种草，不过您的草OUT啦！\n长城永远人挤人，一到节假日，上了长城连烽火台和城墙都看不到，只能看到前面乌泱泱的人头，拍张照片，都不知道谁是主角儿！不到长城非好汉，结果“除了人啥也没看见”！\n那是因为你没有找对长城啊！长城辣么长！! 你为什么非要去八达岭呢？\n拒绝人山人海，“打卡慕田峪长城”哦！和很多歪果仁一起爬长城，连奥巴马和川普的夫人，都在这里“拍美照”，秋天的慕田峪是“上帝打翻的调色板”，美得不要。你给慕田峪长城一次机会，它会还你一个“长城最美的风景”！\n\n附长城旅行Tips：\n详细地址：北京怀柔区渤海镇慕田峪长城景区。\n开放时间：8:30-18:00\n长城门票：40元每人（老人学生儿童半价）。\n玩法路线：搭缆车🚡上下，徒步14-20烽火台。\n交通攻略：没有直达公交，建议选择景区直通车“慕巴士”，每日两班。','新年全家去爬慕田峪长城','慕田峪长城',24),(5,'相比八达岭的雄奇，慕田峪显得更加秀丽了一些，相比八达岭的人多，慕田峪显得人少了许多，因此，这几年里来慕田峪的外国朋友越来越多，因为他们不喜欢人挤着人，人挨着人，慕田峪可以给你一个自己的空间和你的朋友、家人拍拍照片、聊聊长城的雄伟、壮丽！慕田峪景色秀丽，它的绿色植被面积达到了90%以上。慕田峪的名字又因坐落于山脚下有个慕田峪村而闻名。因此，去长城，慕田峪为首选。我上次陪家人去慕田峪是今年5月份，天气太美了，我们参加了一个叫慕巴士的旅游专车，非常好，车上有工作人员讲解和帮忙购买长城的门票、缆车票，对于我们这种携老带小的帮了很大的忙，长城上我们玩了4个小时，足够了！慕巴士，大赞啊！','慕巴士之旅','慕田峪长城',0),(6,'去慕田峪爬长城确实是一个好的选择！以前坐公交车，超麻烦。也没必要自驾，山区路况不熟，而且爬完长城回来腿抖酸痛，后来在景区看到了慕巴士游客中心，有直达回北京市区的直通车，感觉真的很方便，作为一个深耕北京多年的人推荐慕巴士！','慕田峪长城与慕巴士之旅','慕田峪长城',45),(7,'还好上个月去了，再晚点又不知道拖到什么时候。行程也很顺利，早上起来吃了个三明治坐地铁到东四十条坐“慕巴士”，大概九点到的景点，没有堵车。车上“慕巴士”工作人员很周到。慕田峪长城不得不说特别漂亮，墙裂推荐。','开心的一天','慕田峪长城',78),(8,'慕田峪长城，景色非常的壮观，原汁原味的古长城，坐慕巴士直通车去很方便，他们有休息区，有午餐自助都非常不错，印象最深的就是他们的导游讲解的非常到位！','慕田峪长城','慕田峪长城',11),(9,'听朋友推荐的，第一次来北京打算去慕田峪长城，从网上订了慕巴士，早上在二环出发，去程导游向我们耐心介绍慕田峪长城的概况，同时替游客提前订购门票并提醒游客在爬长城时应注意的事项，爬完长城还能在慕巴士之家享受美味的自助餐，返程时品尝到了当地的黑枣，导游还向大家介绍北京晚上的特色美食和游览处所，绿色全程可以说是非常贴心啦！','慕田峪长城之行','慕田峪长城',21),(10,'北京八达岭长城永远人挤人👨‍👩‍👧‍👧，一到节假日更是连箭楼和城墙也看不到，只能看到前面乌泱泱的人头。无数人怀揣着\"不到长城非好汉\"的想法兴冲冲地去，又得了\"除了人啥也没看见\"的体验垂头丧气🙍🏼‍♀️地回来了。\n那是因为你没有找对长城啊！！！长城辣么长！！为啥要可着八达岭去呢🤷‍♀️？\n和闻名遐迩的八达岭长城不同的是，慕田峪长城地处较偏，一般旅游团不会选择慕田峪，大部分都是自由行的游客，🚌慕巴士🚌直通车就可以直接抵达慕田峪长城，所以慕田峪的游客密度很低，游览体验非常好。去慕田峪吧，给慕田峪一个机会，它会还你一个真实的原始长城。','2021年雪❄️中慕田峪长城，约吗？','慕田峪长城',13),(11,'慕田峪长城 | 一日游各种玩法\n \n🌸🌸交通方式🌸🌸\n\n❣推荐选择：🚌慕巴士🚌纯玩无购物一日游，省心、省事儿、服务好！\n \n🌸🌸慕巴士纯玩一日游详细介绍🌸🌸\n1⃣下单之后，商家会给下单手机号，以短信的方式发送“乘车确认号”，此号作为上车凭证，大家记得妥善保存哦！\n2⃣按约定日期及时间，在指定地点集合，记得别迟到哦！\n3⃣集合地点：在地铁二号线东四十条C出口向东100米，北京瑞士公寓—恒生银行门口。\n4⃣我们是周六去的慕田峪，当天我们那趟车上除了我们，都是来北京游玩儿的，其实就是散客拼团。\n5⃣我们买的含门票的套票，包含门票、摆渡车往返、简直太省心了！\n6⃣考虑到小柒柒，无法早早出门，我们选择的上午11点那班车，差不多下午1点到的慕田峪，往返缆车，其实时间很充裕的，游玩儿足够了。\n7⃣午餐🌟🌟：慕巴士有自己的餐厅，叫“慕巴士之家”，自助餐50元/人，小朋友免费哦！菜品还算丰富的，柒柒吃了好多意大利面！需要午餐的，直接在大巴上交钱，给餐票。\n8⃣去程路上，导游小姐姐会简单介绍慕田峪长城，还有一些游玩的注意事项，同时会把大家预定的各种票（门票、摆渡车往返、往返缆车），发给大家哦！很贴心呀！\n \n🌸🌸慕田峪长城的三种玩法🌸🌸（大家各取所需哈）\n1⃣带孩子及老人的，建议乘坐缆车往返，上行至14号烽火台，然后依自身身体条件，步行往上走，最远建议步行至18号烽火台就行啦！\n2⃣带小孩儿的，建议乘坐缆车上行至14号烽火台，游览完14-20号烽火台之后，步行下行到6号烽火台，乘坐滑道至山脚，体现一把 “网红大滑梯”带来的刺激！\n3⃣对于年轻人，建议乘坐索道上行+滑道下行，不耽误沿途的每一处风景。\n \n🌸🌸慕田峪长城的小提示🌸🌸\n✔景区大门到摆渡车入口，步行约5-10分钟，路上能看到餐厅、咖啡厅、小商铺、还有卖各种零食的小摊儿，应有尽有！\n✔摆渡车！！一定要坐！！！摆渡车入口到爬长城起点，坐车还要五分钟左右，这段距离千万不能步行！！太远啦！！！门票是含摆渡车费用的！！车票切记留好，返程上车还得出示！\n✔缆车、索道滑道的运营时间要注意，尤其是停运时间，千万不要错过！','慕田峪长城一日游攻略—慕巴士体验','慕田峪长城',25),(12,'不想去八达岭，脸贴前面人屁股爬长城实在爬不下去。想去看一下大家都推荐的“慕田峪长城”。\n提前一周就在“慕巴士官网”上预约了往返车票。乘坐慕巴士直通车，确实很方便，一个半小时就到了慕田峪长城景区。\n\n慕田峪长城名不虚传，风景很美，喜欢这里水的清澈，喜欢山的秀美，喜欢古迹的沧桑，喜欢沿途的友谊。路上的游客，虽然脸孔陌生，但大家都挂着灿烂的微笑！相互都会给予肯定的目光！外国友人也会相互竖起大拇指说句“Good job！”，大家的目标都是一致的，第20号烽火台！最后由于四个月的二宝睡着了，老公抱着他停止在了19号烽火台！其余全家都登上了20号烽火台！大宝还得了一块奖牌，很是骄傲！总体来说，是一次愉快和温暖的旅程！\n\n写几点建议：\n1：交通乘坐慕巴士，坐这个慕巴士一站直达，时间安排很合理，时间充足。\n2：缆车是封闭式的，索道就是个座椅感觉不安全\n3：缆车上去是14号烽火台，索道上去6号，6号到14号的距离感觉挺远的，应该有不少人6-14就走累了，所以体力不好的直接买缆车吧，不过索道下山可以走滑道，体验挺刺激\n4：6-20号烽火台要80分钟左右，所以时间很充足，千万别急慢慢走可以走到最高处。\n5：坐索道6号到14号的距离比较远，14到20就不怎么远了，就是有的地方陡的厉害。\n\n\n因为女儿的缘故，所以又再次来了趟北京！长城也是她最好去的地方！一直犹豫到底是去哪段长城，再看攻略时觉得慕田峪长城不错！但如何去一直是我比较揪心的事情，又不想让小朋友太早上，还想让她玩尽兴，这时我看到有介绍“慕巴士”的，最吸引我的是5小时的游览时间和全程无购物，因此选择了它。今天一出东四十条c口，往东走个50米看到了慕巴士和穿着红马甲工作人员。七点十几分就发车，坐满人，随到随走。\n王军导游非常耐心，态度也温和，给大家把行程交代得清清楚楚，有问必答。全程无购物！而且，到了景区帮忙购买门票索道票，送我们到检票口后就自由安排。\n\n这次的慕田峪之旅从头到尾体验感极佳！\n值得推荐给朋友们！慕田峪长城，这里木有旅游团，木有抬头看屁股，回头看人头的拥挤！ 长城既有美丽风光，也有长城的险峻风貌。 \n\n小朋友要做索道和滑车，所以我们是从6号烽火台开始往20号行进！（9点下车，加上索道排队时间，到达6号烽火台9点22）小朋友的尽头比较大，一路给麻麻打气、加油！6到14烽火台差不多用了50分钟,中间休息了三次吃东西补充体能。14到20（主要是19到20比较难，要手脚并用）来回用了快2个小时，最后再由14到6就比较快了，小朋友一心想做滑车！幸运的是双人不用排队，到达山下是1点20！然后慕巴士之家餐厅用餐，奖励小朋友一个冰淇凌！','慕田峪长城慕巴士很方便！！！','慕田峪长城',45),(13,'一个很不错的小众长城，人不是很多但是风景很不错，比八达岭长城要近一些，可以去体验体验就是爬起来太累了哈哈哈','不错哈','慕田峪长城',56),(14,'服务还不错，工作人员态度还都挺好，就是上坡太废劲，轮椅上不去，下来也很废劲，上面卖水太贵，20块一瓶，下面一个步行街，东西稍微便宜点。','还不错的旅行','慕田峪长城',23),(15,'今天虽有些小雨，但是和友人依然决定出游慕田峪长城，提前预约了赞巴士直通车，第二天如约到达和平西桥地铁站b口，小赞同学早已在那里等候，心里暖暖的。测体温，检查健康宝，就上车了。大巴宽敞明亮，干净舒适。在车上小赞同学帮我们买票，1小时就到慕田峪长城了。我们拿到票后，就直接坐摆渡车到达长城脚下登城了。坐缆车来到了14号敌楼，在这里和最明显的地标合了一个影儿，又继续往高处爬去。满眼的绿色，眼睛得到最大化的放松。尽管稀稀拉拉地飘着小雨，但是我们很热。来到了17-18敌楼，看到身边云雾缭绕，情不自禁地把头伸出了墙外，闭着眼睛深深地吸气，天然氧吧，名不虚传。雨中的慕田峪长城，真优美，真神秘。来到了好汉坡，抬头一看，乖乖，90度，需手脚并用爬上去。上去以后，真是“一览众山小”，小雨，微风，汗水搅在一起，感觉很好……该下山了，坐缆车回到长城脚下，又坐摆渡车回到了赞巴士休息区。里面也很大，提供免费热水，还有最爱的酸梅汤呢。15:00准时返程，1小时左右又回到了早上集合的地方。分手时，送了我一个纪念品。哇，好有心呀。赞巴士，值。','赞巴士，值','慕田峪长城',85),(16,'慕田峪长城因其景色秀美、地势平缓、修缮保存完好成为中外知名度最高，最受喜爱的一段长城，以前因远离市区交通不便，现在涌现出的直通车完美解决了交通不便，上次去慕田峪长城乘赞巴士，服务好，还有专属休息区，为旅客提供了便捷的出行方式，很赞！！！','美丽的慕田峪长城','慕田峪长城',21),(17,'北京有三个长城，但我看了网上的攻略，都推荐慕田峪长城的原因，人少景美，因为旅游团基本都去八达岭长城，对于假期期间去的我们来说，别无选择。\n\n对于路程，我是在携程网上定的赞巴士，大家可以自行上各种旅游网站搜索慕田峪长城一日游，根据自己的需求选择。我也是第一次上网预订一日游，感觉还不错，所有人集中一个时间点和地点上车，有导游在车上介绍一下接下来去到的景点，还有各种约定的时间，到达那里之后导游会帮忙买好票推荐游玩线路，还是很方便的，少走许多弯路。\n\n进去景区后，我们选择的是坐缆车往返，人民币¥120/人，缆车上去后就是14号峰台，然后从14号爬到20号峰台，就是慕田峪长城景区的最高点了，再从20号峰台回到14号乘坐缆车下去，就是相对来说没有那么累，也是导游推荐的方法之一，喜欢运动的可以选择其他方式，有索道滑道这些，导游会和你们讲清楚的，大家自行选择。爬上20号峰台风景真的很美，建议一定要努力爬上去20号峰台看看风景，才算没白来（Tips：最好身上带上足够零食和水，长城上边矿泉水最高卖¥20/瓶，景区价格你懂的）\n\n从长城上下来后还没有到集合的时间点，就到景区的赞巴士休息区看了会书，而且回去的路上还收到小汽车作为礼物。','一日游','慕田峪长城',78),(18,'几年前的秋天去爬过慕田峪长城，漫山遍野被红叶点缀，很美。几年前的秋天去爬过慕田峪长城，漫山遍野被红叶点缀，很美。','慕田峪长城','慕田峪长城',12),(19,'夏天的北京又炎热又绚丽~🌤️😃\n世界上数一数二的伟大建筑，屹立不摇的盘据于北方山脊间！一生人必要去一次的景点～万里长城\n一共有十三关，走了天下第一雄关居庸关，居庸关被视为抵御北方敌人侵扰的重要屏障。其战略地位十分重要，一旦居庸关失守，攻城军队便可长驱直入，是守卫京城最重要的一道防线！','万里长城～天下第一雄关','慕田峪长城',54),(20,'八达岭人太多了，去慕田峪长城吧！\n都说“不到长城非好汉”来了北京怎么能错过经典的世界八大奇迹之一。虽说北京有好几处长城，而以八达岭最具代表性，但是我个人却并不推荐八达岭，而是更建议去慕田峪长城！\n慕田峪长城位于怀柔区，距离北京市区大约一个多小时的车程，是北京的新十六景之一。往西连接着居庸关长城，往东连接着古北口。慕田峪是北京目前现存的最长的长城，已经开发的区域长达2250米，最经典的取景就是正关台的三座敌楼并矗，属于比较罕见的长城一景。这里的一部分长城要比金山岭看着更原始一些，坡度也陡，所以相对爱运动的游客比较建议徒步。这里还有一个很刺激的娱乐项目，就是滑道，是一个从长城高处一路滑下来的体验项目，是年轻游客的首选。而且这里的游客相比八达岭要少很多，并且多以外国人为主，乍一看还以为出国了呢，外宾更喜欢游览慕田峪长城。\n如果是乘坐公共交通，等待时间比较长，而且得卡着最后一班回北京的公交车。\n安利一种很方便的交通工具：就是北京市区到慕田峪长城的直达交通--赞巴士直通车；\n乘车点：北京市区地铁5号线和平西桥站B出口集合，出发5分钟即上京承高速，不用担心市区的堵车；车上安排导游随车，协助大家购买景区门票，赠送往返双程的摆渡车，景区小镇上有专属的室内休息室，冬暖夏凉，有座椅和免费热水提供；\n出行时间：工作日：早8点--8点半区间流水发车，坐满就走；周末和节假日：早7点半--8点区间流水发车，坐满就走；\n慕田峪景区的开放时间：旺季8：00-17：00；淡季8：30-16：30；\n门票：成人40元/人，往返缆车120元/人，往返滑道120元/人，单程都是60元/人。','来到北京，你到底会去哪段长城？','慕田峪长城',35),(21,'来过很多次慕田峪长城了，感觉这里比八达岭和居庸关要好爬一些，但是也很累。四季过来都有美景。还有不要在这里乱扔垃圾，因为清理很辛苦。','雄伟','慕田峪长城',78),(22,'冬天虽然有些寒冷，但爬长城时会边爬边流汗，所以，反倒很舒服。\n坡度有陡有缓，还看得见残雪痕迹，十分美丽。','美丽的长城','慕田峪长城',98),(23,'没有八达岭长城雄伟，但是胜在险峻，真的赞叹古人伟大的智慧和勇气！这次去有个小遗憾，我的相机摔坏了，所以拍的照片都丢了...','还不错的体验','慕田峪长城',25);
/*!40000 ALTER TABLE `comments` ENABLE KEYS */;
UNLOCK TABLES;

