INSERT INTO `spots` VALUES ('中山公园','https://dimg04.c-ctrip.com/images/02Y2o120009bg80pu5B58_R_1080_808_Q90.jpg','公园','中山公园位于北京市中心紫禁城（故宫）南面，天安门西侧，与故宫一墙之隔。占地23万平方米，是—座纪念性的古典坛庙园林。它原是明清两代的社稷坛，与太庙（今劳动人民文化宫）一起沿袭周代以来“左祖右社”的礼制建造。',334,'北京市中山公园'),('北京八达岭长城','https://dimg04.c-ctrip.com/images/02Y2g120009bg7lle1C16_R_1080_808_Q90.jpg','建筑 •历史遗迹','八达岭长城，位于北京市延庆区军都山关沟古道北口。是中国古代伟大的防御工程万里长城的重要组成部分，是明长城的一个隘口。八达岭长城为居庸关的重要前哨，古称“居庸之险不在关而在八达岭”。\r\n明长城的八达岭段被称作“玉关天堑”，为明代居庸关八景之一。八达岭长城是明长城向游人开放最早的地段，八达岭景区以八达岭长城为主，兴建了八达岭饭店和由江泽民主席亲笔题名的中国长城博物馆等功能齐全的现代化旅游服务设施。\r\n八达岭景区是全国文明风景旅游区示范点，以其雄伟的景观、完善的设施和深厚的文化历史内涵而著称于世，是举世闻名的旅游胜地。',11052,'北京八达岭长城'),('北京欢乐谷','https://dimg04.c-ctrip.com/images/02Y3m120009bgbf98189E_R_1080_808_Q90.jpg','主题公园','北京欢乐谷是国家AAAA级旅游景区、新北京十六景、北京文化创意产业基地，由华侨城集团创办，是集国际化、现代化的主题公园。位于北京市朝阳区东四环四方桥东南角，占地56万平方米。其中，公园一期占地约54万平方米，于2006年7月29日正式开放。公园分别由峡湾森林、亚特兰蒂斯、失落玛雅、爱琴港、香格里拉、甜品王国和欢乐时光七个主题区组成。\r\n北京欢乐谷设置了50余项主题景观、10余项主题表演、30多项主题游乐设施、20余项主题游戏及商业辅助设施，每天提供近80场的表演，可以满足不同人群的需要。获得过“中国文化创意产业高成长企业百强”“首都旅游紫禁杯先进集体”“首都文明旅游景区”等荣誉。',773,'北京市欢乐谷'),('北海公园','https://dimg04.c-ctrip.com/images/02Y17120009bg6eyd9F0C_R_1080_808_Q90.jpg','公园 •水域','北海公园（Beihai Park），位于北京市西城区文津街1号，东邻景山公园，南濒中南海，北连什刹海，全园占地68.2万平方米（其中水域面积38.9万平方米，陆地面积29.3万平方米），1925年开放为公园。\r\n北海公园全园以北海为中心，辽、金、元在此建离宫，明、清辟为帝王御苑，属于中国古代皇家园林。\r\n北海及团城于1961年被中华人民共和国中央人民政府公布为第一批全国重点文物保护单位。北海公园也是国家AAAA级旅游景区',2356,'北京市北海公园'),('午门','https://dimg04.c-ctrip.com/images/02Y3v120009bga4jo430E_R_1080_808_Q90.jpg','古迹 •建筑','午门（Meridian Gate），位于北京市东城区景山前街4号北京故宫内，是北京故宫的正门，位于北京故宫南北轴线，平面呈“凹”字形，通高37.95米，始建于明永乐十八年（1420年），清顺治四年（1647年）重修，清嘉庆六年（1801年）再修。\r\n午门东西北三面城台相连，环抱一个方形广场。北面门楼，面阔九间，重檐黄瓦庑殿顶。东西城台上各有庑房十三间，从门楼两侧向南排开，形如雁翅，也称雁翅楼。在东西雁翅楼南北两端各有重檐攒尖顶阙亭一座。',988,'北京市午门'),('古北口长城','https://dimg04.c-ctrip.com/images/02Y21120008payc7rCBBA_R_1080_808_Q90.jpg','古迹 •建筑','古北口长城是中国长城史上最完整的长城体系。由北齐长城和明长城共同组成，包括卧虎山、蟠龙山、金山岭和司马台4个城段。古北口是山海关、居庸关两关之间的长城要塞，为辽东平原和内蒙古通往中原地区的咽喉，历来是兵家必争之地，尤其是在辽、金、元、明、清这五朝，大大小小争夺古北口的战役从未停止过，因此长城的作用突显得尤为重要。古代称大道为关，小道为口，坐落在燕山山脉的古北口，正是万里长城的众多关口之一。',230,'北京市古北口长城'),('古北水镇','https://dimg04.c-ctrip.com/images/02Y1n120008owablq9B94_R_1080_808_Q90.jpg','古迹徒步','古北水镇，位于北京市密云区古北口镇司马台村，因位于古北口附近又有江南水乡乌镇风格而得名。总面积9平方千米，于2010年新建打造。\r\n古北水镇度假区整体规划为“六区三谷”，分别为老营区、民国街区、水街风情区、卧龙堡民俗文化区、汤河古寨区、民宿餐饮区与后川禅谷、伊甸谷、云峰翠谷。古北水镇是集观光游览、休闲度假、商务会展、创意文化等旅游业态为一体，服务与设施一流、参与性和体验性极高的综合性特色休闲国际旅游度假区。',328,'北京市古北水镇'),('司马台长城','https://dimg04.c-ctrip.com/images/02Y0i120009bg4tb563C9_R_1080_808_Q90.jpg','州立公园 •历史遗迹','司马台长城位于北京市东北部密云区北部的古北口镇司马台村北，紧邻古北水镇，距离北京120公里，属燕山山脉，司马台长城依险峻山势而筑，并以险、密、齐、巧、全五大特点著称于世。\r\n司马台长城东起望京楼，西至后川口，全长5.7公里，其中鸳鸯湖水库将该长城分为东西两段。东段有敌楼16座，西段有敌楼19座，共计35座（包括已毁水中一座）。1987年司马台长城被列入世界遗产名录，是我国唯一保留明代原貌的古建筑遗址，被联合国教科文组织确定为“原始长城”。',484,'北京市司马台长城'),('国家大剧院','https://dimg04.c-ctrip.com/images/02Y3m120009bgis0u00E6_R_1080_808_Q90.jpg','建筑 •剧院','中国国家大剧院（National Centre for the Performing Arts），是新“北京十六景”之一的地标性建筑，位于北京市中心天安门广场西，人民大会堂西侧，由主体建筑及南北两侧的水下长廊、地下停车场、人工湖、绿地组成',751,'北京市国家大剧院'),('天坛公园','https://dimg04.c-ctrip.com/images/02Y49120009bwsf033D94_R_1080_808_Q90.jpg','公园 •古迹','天坛公园由两道坛墙环绕，被分为“内坛”“外坛”两部分；域北呈圆形，南为方形，寓意“天圆地方”；主要由春季祈祷丰年的“祈谷坛”，冬至日祭天的“圜丘坛”，皇帝祭祀前居住的斋宫、演习祭祀礼乐的神乐署四大古建筑群组成；祈谷坛中的祈年殿是北京市的标志性建筑。天坛公园外坛种植有大量古柏林 ',12196,'北京市天坛公园'),('太和殿','https://dimg04.c-ctrip.com/images/02Y5n120009bga6bt44F9_R_1080_808_Q90.jpg','建筑','太和殿，又称“金銮殿、至尊金殿、金銮宝殿”，位于北京市东城区景山前街4号故宫博物院内，矗立在紫禁城中央，建筑面积2377平方米， 是紫禁城（故宫）中最大的殿宇、东方三大殿之一。京城的中轴子午线沿着龙纹石雕御路升上三台，从天子宝座下穿过，是中国现存规制最高的古代宫殿建筑，是皇帝举行重大朝典之地。大殿内外饰以成千上万条金龙纹，屋脊角安设十个脊兽，在现存古建筑中仅此一例。明永乐十八年（1420年），太和殿建成，初名奉天殿；后经数次灾毁和重建；明嘉靖朝改名皇极殿；满清建都北京后改为今名；现太和殿是清康熙年重建并留存下来的。',1187,'北京市太和殿'),('居庸关长城','https://dimg04.c-ctrip.com/images/02Y2d120008isss3t6948_R_1080_808_Q90.jpg','古迹','居庸关长城建在一条长达15公里的山谷间，两旁山峦重叠，树木葱郁，山花烂漫，景色瑰丽，远在800年前的金代，就被列为燕京八景之一，称为“居庸叠翠”。居庸关是从北面进入北京的门户，有“一夫当关，万夫莫开”的气势。居庸关的中心还保存着一个雕刻精美的汉白玉石台“云台”。在元朝时，台上建有三座石塔，于元末明初被毁。三塔被毁后，在此台上又建一院“泰安寺”，此寺于清康熙年间被火焚毁，只剩下这个基座——云台。云台的券门内，石壁上雕刻有四大天王像，姿态传神；还刻有梵文、藏文、蒙文、维吾尔文、西夏文、汉文六种文字组成的佛经。',2553,'北京市居庸关长城'),('平谷将军关长城','https://dimg04.c-ctrip.com/images/02Y0b120008patpzb7AB7_R_1080_808_Q90.jpg','古迹 •建筑','将军关又名将军石关，位于平谷县靠山集乡将军关村，是万里长城北京段最东端的一个关口。将军关建于明代，正关上有3层敌楼，内墙有券门可出入，门南为演武场，正关东侧是水关。现存水关东侧一座敌楼台基和一段城垣。城内有一柱形巨石，高10米有余，称“将军石”。\r\n将军关，位于金海湖镇将军关村内，西邻胡陡路，是明代长城进入北京东侧的第一座重要关口，也是平谷区保存状况最好的关城。其东与天津蓟县接壤，北与河北兴隆毗邻。将军关关城建于明永乐年间（1403-1424），历史上为咽喉要塞，是兵家必争之地。将军关大部分建筑已毁，现仅存关城东侧敌台遗址，关城两侧连接的长城是平谷区唯一一处以砖作为墙体建筑材料的长城段。',400,'北京市平谷将军关长城'),('慕田峪长城','https://dimg04.c-ctrip.com/images/02Y2e120009cif9vwB1AB_R_1080_808_Q90.jpg','景点与地标 •徒步路线','慕田峪长城是明代万里长城的精华所在，该段长城东连古北口，西接居庸关，自古以来就是拱卫京畿的军事要处，有正关台、大角楼、鹰飞倒仰等景观，长城墙体保持完整，较好地体现了长城古韵，有着深厚的历史价值和较高的文化价值。',23789,'北京市慕田峪长城'),('故宫九龙壁','https://dimg04.c-ctrip.com/images/02Y6r120009bg7ytn6138_R_1080_808_Q90.jpg','建筑','九龙壁，位于北京市东城区故宫后宫东路宁寿宫区皇极门外，是一座背倚宫墙而建的单面琉璃影壁，为清乾隆三十七年（1772年）改建宁寿宫时烧造，因影壁上刻有九条龙而得名“九龙壁”。\r\n九龙壁长29.4米，高3.5米，厚0.45米，壁上部为黄琉璃瓦庑殿式顶，檐下为仿木结构的椽、檩、斗栱。壁面雕有九龙，被分隔为五个空间。下部为汉白玉石须弥座，端庄凝重。此九龙壁与山西大同九龙壁、北京北海公园九龙壁合称“中国三大九龙壁”。',495,'北京市故宫九龙壁'),('故宫博物院','https://dimg04.c-ctrip.com/images/02Y4o120009ccjttqF135_R_1080_808_Q90.jpg','特色博物馆 •历史博物馆','北京故宫博物院，是一座综合性博物馆，成立于1925年10月10日，是在明清皇宫及其收藏基础上建立起来的大型综合性古代艺术博物馆。也是中国最大的古代文化艺术博物馆。\r\n故宫博物院占地100余万平方米，保存古建筑约9000间，是中国现存规模最大、保存最完整的古代宫殿建筑群。故宫的前身是明清皇宫紫禁城，于明永乐十八年（1420年）建成，明清两代共有24位皇帝居住于此。1912年溥仪退位后，紫禁城作为皇宫的历史就此终结。1914年，于外朝区域成立古物陈列所；1925年，于内廷区域成立故宫博物院；1948年，古物陈列所并入故宫博物院。故宫博物院院藏文物体系完备，现有藏品总量186万余件（套），依据不同质地和形式，可分为绘画、法书、碑帖、铜器、金银器等25大类，其中珍贵文物占藏品总数的90%。故宫博物院通过明清皇家宫殿建筑，宫廷史迹原状陈列，珍宝、钟表、书画、陶瓷、雕塑等艺术藏品常设展览，以及临时特展等多种方式向公众展现悠久灿烂的中华文明。',14106,'北京市故宫博物院'),('故宫御花园','https://dimg04.c-ctrip.com/images/02Y4x120009bga6x5CE6C_R_1080_808_Q90.jpg','公园','御花园东西宽135米，南北深89米，占地面积12015平方米。其南侧为坤宁门，左右分别有琼苑右门和琼苑左门。北面过集福门、延和门、承光门围合的牌楼门和顺贞门。园内建筑以钦安殿院落为中心，采取中轴对称的布局，东西两路建筑基本对称，是古典宫廷园林的典范',2043,'北京市故宫御花园'),('故宫珍宝馆','https://dimg04.c-ctrip.com/images/02Y31120009bg7sf48781_R_1080_808_Q90.jpg','特色博物馆','珍宝馆位于故宫博物院东部，设在故宫东北角的皇极殿西庑、养性殿、乐寿堂和颐和轩里。\r\n珍宝馆，分设于皇极殿（第一室）、乐寿堂（第二室）、颐和轩（第三室）。主要是清宫收藏的金银玉翠、奇珍异宝制成的礼器、祭器、冠服、装饰品、生活用品以及宫室内的陈设品。\r\n珍宝馆是一座宝库，有各色宝石，闪闪发光的金银器皿，珍珠翡翠，还有金丝凤冠、象牙玉雕，各类珍宝举世无双；最为突出的是有一座镐多塔，重达5000公斤的大型玉雕。',490,'北京市故宫珍宝馆'),('故宫角楼','https://dimg04.c-ctrip.com/images/02Y5b120009bg8j6w3CA2_R_1080_808_Q90.jpg','建筑','紫禁城角楼位于北京市东城区，是一座四面凸字形平面组合的多角建筑，屋顶有三层，上层是纵横搭交的歇山顶，由两坡流水的悬山顶与四面坡的庑殿组合而成，因这种屋顶上有九条主要屋脊，所以称做九脊殿。中层采用勾连搭的做法，用四面抱厦的歇山顶环拱中心的屋顶，犹如众星拱月。下层檐为一环半坡顶的腰檐，使上两层的5个屋顶形成一个复合式的整体。集精巧的建筑结构和精湛的建筑艺术于一身，由于角楼的各部分比例协调，檐角秀丽，造型玲珑别致，成为紫禁城的标志，使人惊奇，赞叹与敬仰。',284,'北京市故宫角楼'),('景山公园','https://dimg04.c-ctrip.com/images/02Y0b120009bg35fh391B_R_1080_808_Q90.jpg','公园 •景点与地标','景山公园位于北京市西城区景山前街，坐落在明清北京城的中轴线上，西临北海，南与故宫神武门隔街相望，是明、清两代的御苑。公园中心的景山为堆土而成，曾是全城的制高点。\r\n景山公园1928年建园，全园总面积23公顷。该公园是国家AAAA级旅游景区， 公园内有绮望楼、五方亭、寿皇殿、永思殿、牡丹园等景点。\r\n2018年9月28日起，公园“满员”后将停止售票。2019年5月6日，首届北京牡丹文化节在延庆开幕，即日起至5月30日，市民可在景山公园等6个园区细赏国色天香。景山公园汇集了国内外牡丹品种569个，共计两万余株，涵盖九大色系、十大花型',2953,'北京市景山公园'),('朝阳剧场','https://dimg04.c-ctrip.com/images/02Y6k120009bg8lzyD1EA_R_1080_808_Q90.jpg','剧院','朝阳剧场是一家以杂技演出为主要经营的场所，剧场建成于一九八四年，并于一九八六年被北京市指定为“旅游演出定点场所”，二零零一年被评为全国文化先进集体。剧场经历了从八十年代中后期为中外来宾游客举办歌舞、戏剧等大型文艺演出的阶段性调整，后定位杂技专场演出，经过二十余年的特色经营，已形成“看杂技到朝阳”的文化品牌。',1330,'北京市朝阳剧场'),('清华大学','https://dimg04.c-ctrip.com/images/02Y60120009bg6vg0784F_R_1080_808_Q90.jpg','教育机构','清华大学（Tsinghua University），简称“清华”，位于北京市海淀区，是中华人民共和国教育部直属的全国重点大学，位列国家“双一流”、“985工程”、“211工程”，入选“2011计划”、“珠峰计划”、“强基计划”、“111计划”，为九校联盟（C9）、松联盟、中国大学校长联谊会、亚洲大学联盟、环太平洋大学联盟、中俄综合性大学联盟、清华—剑桥—MIT低碳大学联盟成员、中国高层次人才培养和科学技术研究的基地，被誉为“红色工程师的摇篮”。',340,'北京市清华大学'),('祈年殿','https://dimg04.c-ctrip.com/images/02Y5h120009bgb8ts7726_R_1080_808_Q90.jpg','建筑','祈年殿前身“大祀殿”，是北京天坛的主体建筑，又称祈谷殿，是明清两代皇帝孟春祈谷之所，是古代明堂式建筑仅存的一例。祈年殿位于北京市东城区天坛东路。 \r\n祈年殿始建于明永乐十八年（1420年）。清光绪十五年（1889年）9月18日，祈年殿焚毁于雷火，次年开始重建，于清光绪二十二年（1896年）完工，用时6年。1970年10月至1971年9月，祈年殿按雷火焚毁前重新修建。祈年殿大殿面积460平方米，是一座鎏金宝顶、蓝瓦红柱、金碧辉煌的彩绘三层重檐圆形大殿。祈年殿采用的是上殿下屋的构造形式。祈年殿是按照“敬天礼神”的思想设计的，殿为圆形，象征天圆；瓦为蓝色，象征蓝天。这种设计受到了“天蓝地黄”传统观念的影响。祈年殿独特的结构特征使得这种形式的仿古建筑结构性能与其现代建筑有所不同，并为今后仿古建筑进一步研究提供了思路。',716,'北京市祈年殿'),('箭扣长城','https://dimg04.c-ctrip.com/images/02Y06120009bg5qiiC162_R_1080_808_Q90.jpg','古迹','箭扣长城位于北京市怀柔区西北的八道河乡境内，海拔1141米，距怀柔区中心约30公里，山势非常富于变化，险峰断崖之上的长城也显得更加雄奇险要。箭扣长城因整段长城蜿蜒呈英文字母“W”状，形如满弓扣箭而得名。箭扣长城是明代万里长城最著名的险段之一，是近年来各种长城画册中上镜率最高的一段，向来是长城摄影的热点。',960,'北京市箭扣长城'),('雍和宫','https://dimg04.c-ctrip.com/images/02Y2b120008ovswuaAC17_R_1080_808_Q90.jpg','历史博物馆','雍和宫（The Lama Temple），位于北京市区东北角，清康熙三十三年（1694年），康熙帝在此建造府邸、赐予四子胤禛，即后来的雍亲王府。雍正三年（1725年），改王府为行宫，称雍和宫，雍正十三年（1735年），雍正帝驾崩，曾于此停放灵柩，因此，雍和宫主要殿堂原绿色琉璃瓦改为黄色琉璃瓦。',4203,'北京市雍和宫'),('颐和园','https://dimg04.c-ctrip.com/images/02Y2x120009f142ysDF78_R_1080_808_Q90.jpg','景点与地标 •建筑','颐和园，中国清朝时期皇家园林，前身为清漪园，坐落在北京西郊，距城区15公里，全园占地3.009平方公里（其中颐和园世界文化遗产区面积为2.97平方公里），水面约占四分之三。与圆明园毗邻。它是以昆明湖、万寿山为基址，以杭州西湖为蓝本，汲取江南园林的设计手法而建成的一座大型山水园林，也是保存最完整的一座皇家行宫御苑，被誉为“皇家园林博物馆”。',15030,'北京市颐和园'),('颐和园佛香阁','https://dimg04.c-ctrip.com/images/02Y65120008oj7w9315AB_R_1080_808_Q90.jpg','建筑','佛香阁，位于北京市海淀区颐和园内万寿山前山台基上，南俯昆明湖、排云殿，北靠佛教建筑“智慧海”，始建于清乾隆十六年（1751年），后毁于英法联军，于清光绪二十年（1894年）完成重建。\r\n佛香阁高36米，坐落在高21米的台基上；共有三层、八角、四重檐，为攒尖顶，阁内有八根巨大铁梨木擎天柱，内部建筑结构复杂。佛香阁内供奉有铜铸金裹千手观世音菩萨站像，清光绪年间（1875—1908年），慈禧太后每月都会来到佛香阁烧香礼佛。',261,'北京市颐和园佛香阁'),('颐和园长廊','https://dimg04.c-ctrip.com/images/02Y2y120009bgae9e628F_R_1080_808_Q90.jpg','景点与地标','颐和园长廊在万寿山南麓和昆明湖北岸之间。始建于清代乾隆十五年（1750），1860年被英法联军焚毁后，于1888年又重新建造。长廊东起邀月门，西至石丈亭，中间穿过排云门，象征春夏秋冬四季。全长728米，共273间，有548根柱子。长廊以其精美的建筑、曲折多变和极丰富的彩画而颇负盛名，是我国古建筑和园林中最长的廊。长廊还是一条五光十色的画廊，廊间的每根枋梁上都绘有彩画，共14000余幅，色彩鲜明，富丽堂皇。彩画的内容多为山水、花鸟图以及中国古典四大名著的情节。画师们将中华数千年的历史文化浓缩在这长长的廊子上。',3392,'北京市颐和园长廊'),('黄花城长城','https://dimg04.c-ctrip.com/images/02Y66120009bfz83oE4F4_R_1080_808_Q90.jpg','景点与地标','黄花城水长城旅游区位于北京市怀柔区九渡河镇境内，距北京市区65公里，是以奇而著称，融山川、碧水、古长城为一体的旅游休闲胜地。而这里的“三绝景”更是引人入胜，叹为观止。\r\n“一绝”建于明永乐年间的长城盘旋于山脊之上，环绕在灏明湖畔，景色秀美壮观。\r\n“二绝”湖水将长城自然断开，形成长城戏水、水没长城的奇特景观。\r\n“三绝”明代板栗园，古树盘根错节，形态各异。那巨龙戏珠之躯和撑掩苍天之冠，令人赞不绝口。',1192,'北京市黄花城长城');
